import React from "react";

function Cart(props) {
  return (
    <div>
      {props.cart.map((item) => (
        <div>
          <h3>{item.name}</h3>
          <h4>{item.cost}</h4>
          <img className="productimg" src={item.img} />
        </div>
      ))}
    </div>
  );
}

export default Cart;
